  false,\n\t\"url\": null,\n\t\"notes\": \"The 2002 region-wide survey for Atlantic
  surfclam (Spisula solidissima) and Ocean Quahog (Arctica islandica) was conducted
  in continental shelf waters, from Delmarva Peninsula to Georges Bank aboard the
  FRV DELAWARE II. The survey, conducted by the NMFS Northeast Fisheries Science Center,
  provides indices of abundance and recruitment for both species. In addition, tows
  were made at 25 non-random sites during the survey to support on-going scientific
  studies.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
